قال رسول الله ﷺ: « أَيعجِزُ أحدُكم أن يقرأَ في ليلةٍ ثُلُثَ القرآنِ؟ قالوا: وكيف يقرأ ثُلُثَ القرآنِ؟ قال: "قُلْ هُوَ اللهُ أَحَدٌ" ، تعدِلُ ثُلُثَ القرآنِ »

﷽ ﴿قُل هُو اللهُ أحَدٌ ۞ اللهُ الصمَد ۞ 
لَم يلِد ولم يُولد ۞ ولَم يكُن له كفوًا أحد﴾
